import Document,{ Head, Main, NextScript} from 'next/document';


export default class NewDocument extends Document{
    render(){
        return(
            <html>
            <Head>
            <title>AppWorks</title>
            <link rel= "stylesheet" href="/_next/"/>
            </Head>
            <body>
            <Main />
            <NextScript/>
            </body>
            </html>
        )
    }
}
